@hellishwaitress @iBirdLite @cotswold31415 @CarolineLucas "to pursue a strategy that defuses that thing"
Is this what the leadership want? As you yourself said, they are very cagey. So, what if they have no intention of stopping Brexit? 
They seem to be very much #proBrexit. So... not sure what their strategy is supposed to defuse.

